PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE meta (
  key   TEXT PRIMARY KEY,
  value TEXT NOT NULL
);
CREATE TABLE vendors (
  vid  INTEGER PRIMARY KEY,
  name TEXT NOT NULL
);
CREATE TABLE products (
  vid  INTEGER NOT NULL,
  pid  INTEGER NOT NULL,
  name TEXT NOT NULL,
  PRIMARY KEY (vid, pid),
  FOREIGN KEY (vid) REFERENCES vendors(vid) ON DELETE CASCADE
);
CREATE TABLE interfaces (
  vid  INTEGER NOT NULL,
  pid  INTEGER NOT NULL,
  iid  INTEGER NOT NULL,
  name TEXT NOT NULL,
  PRIMARY KEY (vid, pid, iid),
  FOREIGN KEY (vid, pid) REFERENCES products(vid, pid) ON DELETE CASCADE
);
CREATE TABLE usb_classes (
  class_id INTEGER PRIMARY KEY,
  name     TEXT NOT NULL
);
CREATE TABLE usb_subclasses (
  class_id    INTEGER NOT NULL,
  subclass_id INTEGER NOT NULL,
  name        TEXT NOT NULL,
  PRIMARY KEY (class_id, subclass_id),
  FOREIGN KEY (class_id) REFERENCES usb_classes(class_id) ON DELETE CASCADE
);
CREATE TABLE usb_protocols (
  class_id    INTEGER NOT NULL,
  subclass_id INTEGER NOT NULL,
  protocol_id INTEGER NOT NULL,
  name        TEXT NOT NULL,
  PRIMARY KEY (class_id, subclass_id, protocol_id),
  FOREIGN KEY (class_id, subclass_id) REFERENCES usb_subclasses(class_id, subclass_id) ON DELETE CASCADE
);
CREATE TABLE audio_terminal_types (
  terminal_type INTEGER PRIMARY KEY,
  name          TEXT NOT NULL
);
CREATE TABLE hid_descriptor_types (
  descriptor_type INTEGER PRIMARY KEY,
  name            TEXT NOT NULL
);
CREATE TABLE hid_descriptor_item_types (
  item_type INTEGER PRIMARY KEY,
  name      TEXT NOT NULL
);
CREATE TABLE physical_bias_types (
  bias_type INTEGER PRIMARY KEY,
  name      TEXT NOT NULL
);
CREATE TABLE physical_descriptor_item_types (
  item_type INTEGER PRIMARY KEY,
  name      TEXT NOT NULL
);
CREATE TABLE hid_usage_pages (
  page_id INTEGER PRIMARY KEY,
  name    TEXT NOT NULL
);
CREATE TABLE hid_usages (
  page_id  INTEGER NOT NULL,
  usage_id INTEGER NOT NULL,
  name     TEXT NOT NULL,
  PRIMARY KEY (page_id, usage_id),
  FOREIGN KEY (page_id) REFERENCES hid_usage_pages(page_id) ON DELETE CASCADE
);
CREATE INDEX idx_products_pid ON products(pid);
CREATE INDEX idx_products_vid ON products(vid);
CREATE INDEX idx_interfaces_iid ON interfaces(iid);
CREATE INDEX idx_hid_usages_usage ON hid_usages(usage_id);
COMMIT;
